import React, { useEffect, useState } from 'react';

export default function SensorChart() {

    const [age, setAge] = useState(0);

    const increaseAge = () => {
        setAge(age + 1);
    }

    const decreaseAge = () => {
        setAge(age - 1);
    }
    return (
        <div>
            <h1>Age Counter</h1>
        </div>
    );
}
